                assert(newBranchID === utils.sha3([
                    res.from,
                    abi.fix(47, "hex"),
                    periodLength,
                    block.timestamp,
                    parentBranchID,
                    abi.fix(tradingFee, "hex"),
                    0,
                    branchDescription
                ]));

